import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';
import { LineWeightOutlined } from '@material-ui/icons';

const Lists = (props) => {
    let Delete = false;
    const Remove = () =>{
         Delete = true;
    }
    return (
    <div className="todo_style">
    <span><DeleteIcon onClick={Remove} className="Delete" /></span>
        <li style={{textDecoration:Delete?"line-through":"none"}}>{props.text}</li>
    </div>
    )
}


export default Lists;
